export const environment = {
  production: false,
  easyrtc: {
    serverUrl: 'http://localhost:8000',  // Updated to match server port
    appName: 'voice-video-call-demo',
    enableDebug: true
  },
  onesignal: {
    appId: 'your-onesignal-app-id',
    notificationConfig: {
      sound: 'call_ringtone',
      priority: 'high',
      timeToLive: 30
    }
  }
};
